    return(
        <div className="actorContainer">
            <div className="actorBody">
                <div className="actorPicture"></div>
                <div className="actorBodyText">
                    <h2>{name}</h2>
                    <p>Artemis</p>
                </div>
            </div>
        </div>
    )
}

export default LeadActor;
